script: |
  super -f text -I q7146.spq | sort > q7146.out

inputs:
  - name: q7146.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 * + + col1 + col0 + - col1 + + ( 96 - col2 * col0 ) NOT BETWEEN NULL AND 63;
  - name: tab2

outputs:
  - name: q7146.out
    data: |
      46	51	23
      64	77	40
